I am SO pro-beer activities these days. Beer yoga, beer runs, beer donut tastings… but my favorite is beer trivia. 🤓

@aslin.pgh hosts @buzzworthypubtrivia every Thursday, and we just got back from WINNING tonight’s trivia challenge! 🍻

@aslin.pgh has so many great beers on tap (their smooth/creamy/fruity Clear Nights west coast IPA is a clear winner imo [see what I did there?]), but you really can’t go wrong regardless of whether you’re into lagers, stouts, sours, or ales. 

I have so much love for the Strip District already, and the fact that I have a new fave Thursday beer activity there? The best. 🖤💛

